import db from '../models/index.js'
const getAllPackageList = async () => {
    try {
        let packages = [];
        packages = await db.Packages.findAll();
        return packages;
    } catch (error) {
        console.log(error);
    }
}
const getPackageList = async (page) => {
    try {
        let packages = [];
        const itemsPerPage = 10;
        const offset = (page - 1) * itemsPerPage;
        packages = await db.Packages.findAll({
            offset,
            limit: itemsPerPage
        });
        return packages;
    } catch (error) {
        console.log(error);
    }
}
const getTotalNumber = async () => {
    try {
        let totalNumber = 0;
        totalNumber = await db.Packages.count();
        return totalNumber;
    } catch (error) {
        console.log(error);
    }
}
module.exports = {
    getPackageList, getTotalNumber, getAllPackageList
}

'use strict';

const fs = require('fs');
const path = require('path');
const Sequelize = require('sequelize');
const process = require('process');
const basename = path.basename(__filename);
const env = process.env.NODE_ENV || 'development';
const config = require(__dirname + '/../config/config.json')[env];
const db = {};

let sequelize;
if (config.use_env_variable) {
  sequelize = new Sequelize(process.env[config.use_env_variable], config);
} else {
  sequelize = new Sequelize(config.database, config.username, config.password, config);
}

fs
  .readdirSync(__dirname)
  .filter(file => {
    return (
      file.indexOf('.') !== 0 &&
      file !== basename &&
      file.slice(-3) === '.js' &&
      file.indexOf('.test.js') === -1
    );
  })
  .forEach(file => {
    const model = require(path.join(__dirname, file))(sequelize, Sequelize.DataTypes);
    db[model.name] = model;
  });

Object.keys(db).forEach(modelName => {
  if (db[modelName].associate) {
    db[modelName].associate(db);
  }
});

db.sequelize = sequelize;
db.Sequelize = Sequelize;

module.exports = db;

