const { Sequelize } = require('sequelize');

const sequelize = new Sequelize('tour_booking', 'root', null, {
    host: 'localhost',
    dialect: 'mysql'
});

const connection = async () => {
    try {
        await sequelize.authenticate();
        console.log('Connection has been established successfully.');
    } catch (error) {
        console.log('Unable to connect to the database:', error);
    }
}

export default connection;

import express from "express";
import apiController from '../controller/apiController';
const router = express.Router();

/**
 * 
 * @param {*} app : express app
 */

const initApiRoutes = (app) => {
    router.get("/package-data", apiController.getPackageList);

    return app.use("/api", router);
}

export default initApiRoutes;

import packageService from '../services/packageService';
const getPackageList = async (req, res) => {
    try {
        if (req.query.page != null) {
            const itemsPerPage = 10;
            let data = await packageService.getPackageList(req.query.page);
            let totalList = await packageService.getAllPackageList();
            let totalPage = await totalList.length / itemsPerPage;
            if (totalPage < 1 && totalPage > 0) {
                totalPage = 1;
            }
            return res.status(200).json({
                EM: data.EM,
                EC: data.EC,
                DT: data,
                TotalPage: totalPage,
            });
        }
        else {
            const itemsPerPage = 10;
            let data = await packageService.getPackageList(1);
            let totalList = await packageService.getAllPackageList();
            let totalPage = await totalList.length / itemsPerPage;
            if (totalPage < 1 && totalPage > 0) {
                totalPage = 1;
            }
            return res.status(200).json({
                EM: data.EM,
                EC: data.EC,
                DT: data,
                TotalPage: totalPage,
            });
        }
    } catch (error) {
        console.log('Error caught:', error);
        return res.status(500).json({
            EM: 'error from server', //error message
            EC: '-1', //error code
            DT: '',
        })
    }
}
module.exports = {
    getPackageList
}
